PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE journal (
	id INTEGER NOT NULL, 
	account VARCHAR(255) NOT NULL, 
	bank VARCHAR(255) NOT NULL, 
	hbci_url VARCHAR(255) NOT NULL, 
	last_update DATETIME NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE journalentry (
	id INTEGER NOT NULL, 
	amount INTEGER NOT NULL,
	message TEXT, 
	journal_id INTEGER NOT NULL, 
	other_account VARCHAR(255) NOT NULL, 
	other_bank VARCHAR(255) NOT NULL, 
	other_person VARCHAR(255) NOT NULL, 
	original_message TEXT NOT NULL, 
	timestamp DATETIME NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(journal_id) REFERENCES journal (id)
);
CREATE TABLE "transaction" (
	id INTEGER NOT NULL, 
	message TEXT NOT NULL,
	transaction_date DATETIME NOT NULL,
	journal_entry_id INTEGER, 
    semester_id INTEGER,
	PRIMARY KEY (id), 
	FOREIGN KEY(journal_entry_id) REFERENCES journalentry (id),
    FOREIGN KEY(semester_id) REFERENCES semester (id)
);
CREATE TABLE financeaccount (
        id INTEGER NOT NULL,
        name VARCHAR(127) NOT NULL,
        type VARCHAR(9) NOT NULL,
        user_id INTEGER,
        semester_id INTEGER,
        tag VARCHAR(16),
        PRIMARY KEY (id),
        UNIQUE (semester_id, tag),
        CONSTRAINT financeaccounttypes CHECK (type IN ('LIABILITY', 'EXPENSE', 'ASSET', 'INCOME', 'EQUITY')),
        FOREIGN KEY(user_id) REFERENCES user (id),
        FOREIGN KEY(semester_id) REFERENCES semester (id),
        CHECK (tag IN ('registration_fee', 'additional_fee', 'regular_fee', 'arrears_fee'))
);
CREATE TABLE split (
	id INTEGER NOT NULL, 
	amount INTEGER NOT NULL, 
	account_id INTEGER NOT NULL,
	transaction_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(account_id) REFERENCES financeaccount (id),
	FOREIGN KEY(transaction_id) REFERENCES "transaction" (id)
);
CREATE TABLE trafficvolume (
    id INTEGER NOT NULL,
    size BIGINT NOT NULL,
    timestamp DATETIME NOT NULL,
    type VARCHAR(3) NOT NULL,
    ip_id INTEGER NOT NULL,
    PRIMARY KEY (id),
    CONSTRAINT traffic_types CHECK (type IN ('IN', 'OUT')),
    FOREIGN KEY(ip_id) REFERENCES ip (id)
);
CREATE TABLE semester (
    id INTEGER NOT NULL,
    name VARCHAR(255) NOT NULL,
    registration_fee INTEGER NOT NULL,
    semester_fee INTEGER NOT NULL,
    begin_date DATETIME NOT NULL,
    end_date DATETIME NOT NULL,
    PRIMARY KEY (id)
);
CREATE TABLE "group" (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	type VARCHAR(17) NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE dormitory (
	id INTEGER NOT NULL, 
	number VARCHAR(3) NOT NULL, 
	short_name VARCHAR(5) NOT NULL, 
	street VARCHAR(20) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (number), 
	UNIQUE (short_name)
);
CREATE TABLE vlan (
	id INTEGER NOT NULL, 
	name VARCHAR(127) NOT NULL, 
	tag INTEGER NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE subnet (
	id INTEGER NOT NULL, 
	address VARCHAR(51) NOT NULL, 
	gateway VARCHAR(51) NOT NULL, 
	dns_domain VARCHAR, 
	reserved_addresses INTEGER NOT NULL, 
	ip_type VARCHAR(1) NOT NULL, 
	PRIMARY KEY (id), 
	CONSTRAINT iptypes CHECK (ip_type IN ('4', '6'))
);
CREATE TABLE port (
	id INTEGER NOT NULL, 
	type VARCHAR(15) NOT NULL, 
	name VARCHAR(4) NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE destinationport (
	id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES port (id)
);
CREATE TABLE association_dormitory_vlan (
	dormitory_id INTEGER, 
	vlan_id INTEGER, 
	FOREIGN KEY(dormitory_id) REFERENCES dormitory (id), 
	FOREIGN KEY(vlan_id) REFERENCES vlan (id)
);
CREATE TABLE association_subnet_vlan (
	subnet_id INTEGER, 
	vlan_id INTEGER, 
	FOREIGN KEY(subnet_id) REFERENCES subnet (id), 
	FOREIGN KEY(vlan_id) REFERENCES vlan (id)
);
CREATE TABLE trafficgroup (
	id INTEGER NOT NULL, 
	traffic_limit BIGINT NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES "group" (id)
);
CREATE TABLE room (
	id INTEGER NOT NULL, 
	number VARCHAR(36) NOT NULL, 
	level INTEGER NOT NULL, 
	inhabitable BOOLEAN NOT NULL, 
	dormitory_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	CHECK (inhabitable IN (0, 1)), 
	FOREIGN KEY(dormitory_id) REFERENCES dormitory (id)
);
CREATE TABLE propertygroup (
	id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES "group" (id)
);
CREATE TABLE user (
	id INTEGER NOT NULL, 
	login VARCHAR(40) NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	registration_date DATETIME NOT NULL, 
	passwd_hash VARCHAR, 
	email VARCHAR(255), 
	is_away BOOLEAN NOT NULL, 
	room_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	CHECK (is_away IN (0, 1)), 
	FOREIGN KEY(room_id) REFERENCES room (id)
);
CREATE TABLE patchport (
	id INTEGER NOT NULL, 
	destination_port_id INTEGER, 
	room_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES port (id), 
	FOREIGN KEY(destination_port_id) REFERENCES destinationport (id), 
	FOREIGN KEY(room_id) REFERENCES room (id)
);
CREATE TABLE phoneport (
	id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES destinationport (id)
);
CREATE TABLE property (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	property_group_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(property_group_id) REFERENCES propertygroup (id)
);
CREATE TABLE logentry (
	id INTEGER NOT NULL, 
	type TEXT, 
	message TEXT NOT NULL, 
	timestamp DATETIME NOT NULL, 
	author_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(author_id) REFERENCES user (id)
);
CREATE TABLE host (
	id INTEGER NOT NULL, 
	type VARCHAR(50), 
	user_id INTEGER, 
	room_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES user (id) ON DELETE CASCADE, 
	FOREIGN KEY(room_id) REFERENCES room (id)
);
CREATE TABLE membership (
	id INTEGER NOT NULL, 
	start_date DATETIME NOT NULL, 
	end_date DATETIME, 
	group_id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(group_id) REFERENCES "group" (id) ON DELETE CASCADE, 
	FOREIGN KEY(user_id) REFERENCES user (id) ON DELETE CASCADE
);
CREATE TABLE serverhost (
	id INTEGER NOT NULL, 
	name VARCHAR(255), 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES host (id)
);
CREATE TABLE hostalias (
	id INTEGER NOT NULL, 
	type VARCHAR(50), 
	host_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(host_id) REFERENCES host (id) ON DELETE CASCADE
);
CREATE TABLE switch (
	id INTEGER NOT NULL, 
	name VARCHAR(127) NOT NULL, 
	management_ip VARCHAR(127) NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES host (id)
);
CREATE TABLE netdevice (
	id INTEGER NOT NULL, 
	type VARCHAR(50), 
	mac VARCHAR(17) NOT NULL, 
	host_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(host_id) REFERENCES host (id) ON DELETE CASCADE
);
CREATE TABLE userhost (
	id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES host (id)
);
CREATE TABLE userlogentry (
	id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES logentry (id), 
	FOREIGN KEY(user_id) REFERENCES user (id)
);
CREATE TABLE ip (
	id INTEGER NOT NULL, 
	address VARCHAR(51) NOT NULL, 
	net_device_id INTEGER NOT NULL, 
	subnet_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (address), 
	FOREIGN KEY(net_device_id) REFERENCES netdevice (id) ON DELETE CASCADE, 
	FOREIGN KEY(subnet_id) REFERENCES subnet (id)
);
CREATE TABLE switchnetdevice (
	id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES netdevice (id)
);
CREATE TABLE usernetdevice (
	id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES netdevice (id)
);
CREATE TABLE srvrecord (
	id INTEGER NOT NULL, 
	service VARCHAR(255) NOT NULL, 
	time_to_live INTEGER, 
	priority INTEGER NOT NULL, 
	weight INTEGER NOT NULL, 
	port INTEGER NOT NULL, 
	target VARCHAR(255) NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES hostalias (id)
);
CREATE TABLE nsrecord (
	id INTEGER NOT NULL, 
	domain VARCHAR(255) NOT NULL, 
	server VARCHAR(255) NOT NULL, 
	time_to_live INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES hostalias (id)
);
CREATE TABLE cnamerecord (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	alias_for_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES hostalias (id), 
	FOREIGN KEY(alias_for_id) REFERENCES hostalias (id) ON DELETE CASCADE
);
CREATE TABLE mxrecord (
	id INTEGER NOT NULL, 
	server VARCHAR(255) NOT NULL, 
	domain VARCHAR(255) NOT NULL, 
	priority INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES hostalias (id)
);
CREATE TABLE switchport (
	id INTEGER NOT NULL, 
	switch_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES destinationport (id), 
	FOREIGN KEY(switch_id) REFERENCES switch (id)
);
CREATE TABLE aaaarecord (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	time_to_live INTEGER, 
	address_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES hostalias (id), 
	FOREIGN KEY(address_id) REFERENCES ip (id)
);
CREATE TABLE servernetdevice (
	id INTEGER NOT NULL, 
	switch_port_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES netdevice (id), 
	FOREIGN KEY(switch_port_id) REFERENCES switchport (id)
);
CREATE TABLE arecord (
	id INTEGER NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	time_to_live INTEGER, 
	address_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES hostalias (id), 
	FOREIGN KEY(address_id) REFERENCES ip (id)
);

CREATE TABLE roomlogentry (
	id INTEGER NOT NULL, 
	room_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(id) REFERENCES logentry (id), 
	FOREIGN KEY(room_id) REFERENCES room (id)
);
COMMIT;
